                Character character = { character }
                /> <
                /li>
            );
        });

        return ( <
            section >
            <
            ul className = "cards" > { characterElements } < /ul> <
            /section>
        );
    }
};
CharacterList.propTypes = { character: PropTypes.object };
export default CharacterList;
